package io.input;

import java.io.File;
import java.util.List;

/**
 * 
 * <img src=
 * " data:image/jpeg;base64,"
 * >InputHandling</img>
 * 
 * @author Master
 *
 */
public class TextfileListConverter implements IFileConverter {

  private ARawTypeConverter rawTypeConverter;

  public TextfileListConverter(ARawTypeConverter rawTypeConverter) {

    this.rawTypeConverter = rawTypeConverter;
  }

  @SuppressWarnings("unchecked")
  @Override
  public List<Object> getFormattedContent(File file) {

    AFileLoader fileLoader = new TextfileLoader(file);

    IFileContentHandler fileContentHandler = new RawFileListConverter(
        rawTypeConverter, fileLoader.getFileContent());

    return (List<Object>) fileContentHandler.getFormattedContent();
  }

}
